import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate, useLocation } from "react-router-dom";
import Home from "./pages/Home";
import Products from "./pages/Products";
import Gallery from "./pages/Gallery";
import Contact from "./pages/Contact";
import Login from "./pages/Login";
import Register from "./pages/Register";
import { useAuth } from "./AuthContext";

function ProtectedRoute({ children }) {
  const { isAuthenticated } = useAuth();
  const location = useLocation();
  if (!isAuthenticated) {
    return <Navigate to="/login" state={{ from: location }} replace />;
  }
  return children;
}

function App() {
  const { isAuthenticated, logout } = useAuth();
  return (
    <Router>
      <header>
        <table align="center">
          <tbody>
            <tr>
              <td>
                <img src="/images/logo1.5.jpeg" alt="CRP Logo" className="logo" />
              </td>
              <td>
                <h2 className="logo-text">Classic Royal Printers</h2>
                <p className="tagline">The Complete Printing Solutions</p>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products">Products</Link></li>
          <li><Link to="/gallery">Gallery</Link></li>
          <li><Link to="/contact">Contact</Link></li>
          {!isAuthenticated && <li><Link to="/login">Login</Link></li>}
          {!isAuthenticated && <li><Link to="/register">Register</Link></li>}
          {isAuthenticated && <li><button onClick={logout} className="btn btn-link text-white" style={{textDecoration: 'none'}}>Logout</button></li>}
        </ul>
      </nav>
      <main className="container my-5">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/products" element={<ProtectedRoute><Products /></ProtectedRoute>} />
          <Route path="/gallery" element={<ProtectedRoute><Gallery /></ProtectedRoute>} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </main>
      <footer className="bg-primary text-white text-center py-3">
        <p className="mb-0">&copy; 2025 Classic Royal Printers. All rights reserved.</p>
      </footer>
    </Router>
  );
}

export default App;
